import './App.css';
import React from 'react';


async function fetchData(){

  const response = await fetch('https://opentdb.com/api.php?amount=10&category=10&difficulty=medium')
  const data = await response.json()
  console.log(data)
}
function App() {
  return (
    <div className="App">
      <div className='header-container'>
      <h1>Quizzical</h1>
      <p>Let's get quizzical!</p>
      <button onClick={fetchData}>Hey</button>
      </div>

      <div className='category-container'>
        <h3>Category</h3>
      </div>

      <div className='questions-number-container'>
      <h3>Number of Questions</h3>
      </div>

      <div className='difficulty-container'>
        <h3>Difficulty</h3>
      </div>

      <div className='question-type-container'>
        <h3>Type of Question</h3>
      </div>

      <div className='button-container'>
        <button></button>
      </div>
    </div>
  );
}

export default App;
